    def test_tweet1(self):
        test_obj = json.loads('{"direct_message" : {"text" : "3:48:PM:11/3:mwyzelwmywdinaclojvorrbkeuzpramhqsumdkjwgwgkniwcxfrjtempqjmamwjhidzdgztowmu", "sender_screen_name" : "azeihmutup", "sender" : {"time_zone" : "Atlantic Time (Canada)"}, "recipient" : { "following" : true}}}')
        tested_Tweet = create_tweet(test_obj)
        self.assertEqual(tested_Tweet.hour, 3)
        self.assertEqual(tested_Tweet.minute, 48)
        self.assertEqual(tested_Tweet.period, 'PM')
        self.assertEqual(tested_Tweet.month, 11)
        self.assertEqual(tested_Tweet.day, 3)
        self.assertEqual(tested_Tweet.msg, 'mwyzelwmywdinaclojvorrbkeuzpramhqsumdkjwgwgkniwcxfrjtempqjmamwjhidzdgztowmu')
        self.assertEqual(tested_Tweet.sender, 'azeihmutup')
